import { Component, OnInit, OnDestroy } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { HttpResponse } from '@angular/common/http';
import { Subscription } from 'rxjs';
import { EventManager } from 'app/core/util/event-manager.service';
import { JobExecution, JobExecutionStep, JobExecutionParameter } from './job-execution.model';
import { JobExecutionService } from './job-execution.service';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';
import { JobExecutionExitMessageDialogComponent } from "./job-execution-exit-message-dialog.component";

@Component({
  selector: 'ic-job-execution-detail',
  templateUrl: './job-execution-detail.component.html',
})
export class JobExecutionDetailComponent implements OnInit, OnDestroy {
  jobExecution: JobExecution = new JobExecution();
  jobExecutionStep?: JobExecutionStep[];
  jobExecutionParameter?: JobExecutionParameter[];
  jobScheduleId?: string;
  private subscription?: Subscription;
  private eventSubscriber?: Subscription;

  constructor(private eventManager: EventManager, private jobExecutionService: JobExecutionService, private route: ActivatedRoute, protected modalService: NgbModal) {}

  ngOnInit(): void {
    this.subscription = this.route.params.subscribe(params => {
      this.load(params['id']);
      this.getJobParameters(params['id']);
      this.getJobSteps(params['id']);
    });
    this.registerChangeInJobExecutions();
  }

  load(id: any): void {
    this.jobExecutionService.find(id).subscribe((jobExecutionResponse: HttpResponse<JobExecution>) => {
      this.jobExecution = jobExecutionResponse.body as any;
    });
  }

  getJobParameters(id: any): void {
    this.jobExecutionService.getJobParameters(id).subscribe((jobExecutionParameterResponse: HttpResponse<JobExecutionParameter[]>) => {
      this.jobExecutionParameter = jobExecutionParameterResponse.body as any;
      let param;
      for (param of this.jobExecutionParameter) {
        if (param.keyName === 'id'){
          this.jobScheduleId = param.stringValue;
          break;
        }
      }
    });
  }

  getJobSteps(id: any): void {
    this.jobExecutionService.getJobSteps(id).subscribe((jobExecutionStepResponse: HttpResponse<JobExecutionStep[]>) => {
      this.jobExecutionStep = jobExecutionStepResponse.body as any;
    });
  }

  previousState(): void {
    window.history.back();
  }

  viewExitMessage(exitMessage: string): void {
    const modalRef = this.modalService.open(JobExecutionExitMessageDialogComponent, { size: 'lg', backdrop: 'static' });
    modalRef.componentInstance.exitMessage = exitMessage;
  }

  ngOnDestroy(): void {
    if (this.subscription) {
      this.subscription.unsubscribe();
    }
    if (this.eventSubscriber) {
      this.eventManager.destroy(this.eventSubscriber);
    }
  }

  registerChangeInJobExecutions(): void {
    this.eventSubscriber = this.eventManager.subscribe('jobExecutionListModification', () => this.load(this.jobExecution.id));
  }
}
<div *ngIf="jobExecution">
  <h2><span icTranslate="jobWebApp.jobExecution.detail.title">Job Execution</span> {{ jobExecution.id }}</h2>
  <hr />

  <div class="row">
    <ic-alert-error></ic-alert-error>
  </div>

  <div class="row">
    <div class="rounded-pill col-md-3">
      <label class="form-control-label fw-bold" icTranslate="jobWebApp.jobExecution.jobInstanceId">Job Instance Id</label>
      <div>
        <span>{{ jobExecution.jobInstanceId }}</span>
      </div>
    </div>

    <div class="rounded-pill col-md-3">
      <label class="form-control-label fw-bold" icTranslate="jobWebApp.jobExecution.status">Status</label>
      <div>
        <span>{{ jobExecution.status }}</span>
      </div>
    </div>

    <div class="rounded-pill col-md-3">
      <label class="form-control-label fw-bold" icTranslate="jobWebApp.jobExecution.startTime">Start Time</label>
      <div>
        <span>{{ jobExecution.startTime | date: 'yyyy-MM-dd HH:mm:ss' }}</span>
      </div>
    </div>

    <div class="rounded-pill col-md-3">
      <label class="form-control-label fw-bold" icTranslate="jobWebApp.jobExecution.endTime">End Time</label>
      <div>
        <span>{{ jobExecution.endTime | date: 'yyyy-MM-dd HH:mm:ss' }}</span>
      </div>
    </div>

    <div class="rounded-pill col-md-3">
      <label class="form-control-label fw-bold" icTranslate="jobWebApp.jobExecution.jobName">Job Name</label>
      <div>
        <span>{{ jobExecution.jobName }}</span>
      </div>
    </div>

    <div class="rounded-pill col-md-3">
      <label class="form-control-label fw-bold" icTranslate="jobWebApp.jobExecution.duration">Duration</label>
      <div>
        <span>{{ jobExecution.duration }}</span>
      </div>
    </div>

    <div class="rounded-pill col-md-3">
      <label class="form-control-label fw-bold" icTranslate="schedule.table.id">Job Schedule ID</label>
      <div>
        <span>{{ jobScheduleId }}</span>
      </div>
    </div>
  </div>

  <div>
    <h2>
      <span icTranslate="jobWebApp.jobExecution.stepList.title">Job Step List</span>
    </h2>
    <br />
    <div class="table-responsive" *ngIf="jobExecutionStep">
      <table class="table table-striped">
        <thead>
          <tr>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.id">Step Execution Id</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.stepName">Step Name</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.startTime">Start Time</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.endTime">End Time</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.status">Status</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.commitCount">Commit Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.readCount">Read Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.filterCount">Filter Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.writeCount">Write Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.readSkipCount">Read Skip Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.writeSkipCount">Write Skip Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.processSkipCount">Process Skip Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.rollbackCount">Rollback Count</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.exitCode">Exit Code</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.stepList.exitMessage">Exit Message</span></th>
          </tr>
        </thead>
        <tbody>
          <tr *ngFor="let step of jobExecutionStep">
            <td>{{ step.id }}</td>
            <td>{{ step.stepName }}</td>
            <td>{{ step.startTime | date: 'yyyy-MM-dd HH:mm:ss' }}</td>
            <td>{{ step.endTime | date: 'yyyy-MM-dd HH:mm:ss' }}</td>
            <td>{{ step.status }}</td>
            <td>{{ step.commitCount }}</td>
            <td>{{ step.readCount }}</td>
            <td>{{ step.filterCount }}</td>
            <td>{{ step.writeCount }}</td>
            <td>{{ step.readSkipCount }}</td>
            <td>{{ step.writeSkipCount }}</td>
            <td>{{ step.processSkipCount }}</td>
            <td>{{ step.rollbackCount }}</td>
            <td>{{ step.exitCode }}</td>
            <td>
              <button *ngIf="step.exitMessage" class="btn btn-primary btn-sm" (click)="viewExitMessage(step.exitMessage)">
                <fa-icon [icon]="'search'"></fa-icon>
                <span class="hidden-md-down" icTranslate="jobWebApp.jobExecution.btn.viewExitMessage">View Exit Message</span>
              </button>&nbsp;&nbsp;&nbsp;&nbsp;
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  </div>

  <div>
    <h2>
      <span icTranslate="jobWebApp.jobExecution.parameterList.title">Job Parameter List</span>
    </h2>
    <br />
    <div class="table-responsive" *ngIf="jobExecutionParameter">
      <table class="table table-striped">
        <thead>
          <tr>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.parameterList.id">Job Execution Id</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.parameterList.typeCD">Type Code</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.parameterList.keyName">Key Name</span></th>
            <th scope="col"><span icTranslate="jobWebApp.jobExecution.parameterList.stringValue">String Value</span></th>
<!--            <th><span icTranslate="jobWebApp.jobExecution.parameterList.dateValue">Date Value</span></th>-->
<!--            <th><span icTranslate="jobWebApp.jobExecution.parameterList.longValue">Long Value</span></th>-->
<!--            <th><span icTranslate="jobWebApp.jobExecution.parameterList.doubleValue">Double Value</span></th>-->
<!--            <th><span icTranslate="jobWebApp.jobExecution.parameterList.identifying">Identify</span></th>-->
          </tr>
        </thead>
        <tbody>
          <tr *ngFor="let parameter of jobExecutionParameter">
            <td>{{ parameter.id }}</td>
            <td>{{ parameter.typeCD }}</td>
            <td>{{ parameter.keyName }}</td>
            <td>{{ parameter.stringValue }}</td>
<!--            <td>{{ parameter.dateValue | date: 'yyyy-MM-dd HH:mm:ss' }}</td>-->
<!--            <td>{{ parameter.longValue }}</td>-->
<!--            <td>{{ parameter.doubleValue }}</td>-->
<!--            <td>{{ parameter.identifying }}</td>-->
          </tr>
        </tbody>
      </table>
    </div>
  </div>

  <div class="row">
    <button type="submit" (click)="previousState()" class="btn btn-info btn-sm">
      <fa-icon [icon]="'arrow-left'"></fa-icon>&nbsp;<span icTranslate="entity.action.back"> Back </span>
    </button>
  </div>
</div>
